	f0_local0( self, f1_local1, controller )
	if not CONDITIONS.InKillCam( self ) and not CONDITIONS.IsSpectating( f1_local1 ) then
		ACTIONS.AnimateSequence( self, "BootUp" )
		ACTIONS.AnimateSequence( self, "BootupFlash" )
		ACTIONS.AnimateSequenceByElement( self, {
			elementPath = "self.Reticle105mm",
			sequenceName = "Boot",
			elementName = "Reticle105mm"
		} )
	end
	if CONDITIONS.IsSpectating( f1_local1 ) then
		ACTIONS.AnimateSequence( self, "Spectating" )
		ACTIONS.AnimateSequenceByElement( self, {
			elementPath = "self.WeaponBar",
			sequenceName = "IsCapturingFootage",
			elementName = "WeaponBar"
		} )
	end
	if CONDITIONS.IsSplitscreen( self ) then
		ACTIONS.AnimateSequence( self, "Splitscreen" )
	end
	if CONDITIONS.InKillCam( self ) then
		ACTIONS.AnimateSequence( self, "Spectating" )
		ACTIONS.AnimateSequenceByElement( self, {
			elementPath = "self.WeaponBar",
